import React from 'react'
import { RegionList } from '../helpers/regionlist'
import '../styles/region.css'

function Regions() {
  return (
    <div class='regions'>
        <h1>
            Regions
        </h1>
        <div className="regionslist">
             {RegionList.map((Regionitem, key)=>{
                return (
                    <div className='regionItem'>
                         <div style={{backgroundImage:`url(${Regionitem.image})`}}></div>
                         <p>{Regionitem.name}</p>
                    </div>
                  )
                }
              )}
        </div>
    </div>
  );
}

export default Regions;
